import { StoreContext } from "./storeContext";
import React, { useEffect, useContext, useState } from "react";


const PrintJokes = () =>{
  const [store, setStore] = useContext(StoreContext);
  const j = Object.values(store);
  
  const [jokeCount, setJokeCount] = useState([0])
  
  //console.log(j.map((e,y,i)=>console.log(e["counter"])))
  
  
  useEffect(() => {
    //hae kategoriat jsonilla
    let temp = parseInt(store.values)
    console.log(temp)
    setJokeCount(jokeCount => [...jokeCount + temp])
  }, [store]);

  const counter = () =>{
    let temp = 0;
    //{jokeCount.map((e)=> console.log(e))}
    return <h2>{temp}</h2>
  }
  return(
    <div style={{backgroundColor:"green"  }}>
      <h3>vitsit</h3>
      {console.log(jokeCount)}
      <p>pöö</p>
        {j.map((element, i) => {
            //console.log(i)
            
            return <li key={i}>{i + 1}{". "}{element["joke"]}{" ---------------ja kategory on testissä   "}{element["categories"]}{"\n"}</li>
          })
          
        }
      
      
      
      
      
      
      <p>pöö</p>
      
      <p>{counter()}</p>
    </div>
  )
}
export default PrintJokes;
